import React from "react";
import lodging from "../../data/lodging.json"
import "../styles/tags.sass";


function Tags(props) {
    const { lodging: lodgingData } = props; // Renommez la prop pour éviter le conflit de noms

    return (
      <ul className='Tags-element'>
        {lodgingData.map((lodging) => {
          const { tags } = lodging;
          return (
            <div className="lodgingElement" key={tags}>
              <li className="tags">{tags}</li>

            </div>
          );
        })}
      </ul>
    );
  }

export default Tags;
